# Define your Base64 string here (this would typically come from your API)
$base64String = ""

# Specify the output file name and path (e.g., "output.jpg" or "document.pdf")
$outputFilePath = "output.jpg"

# Convert the Base64 string to a byte array
$fileBytes = [Convert]::FromBase64String($base64String)

# Write the byte array to a file
[System.IO.File]::WriteAllBytes($outputFilePath, $fileBytes)

# Confirmation message
Write-Host "File has been successfully created at: $outputFilePath"
